import React from 'react';
import ReactDOM from 'react-dom/client'; // Import from react-dom/client
import './styles/App.css';
import App from './App';

// In index.js (or wherever your app is rendered)
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
